[('Custom Parser', ['Custom Parser is a free Scraper API feature that lets you define your own parsing and data processing logic that is executed on a raw scraping result.', 'You can use CSS and XPath selectors to select an object in the HTML DOM.', 'To use Custom Parser, just pass a JSON object with instructions while submitting a job:', 'If you are using XPath selectors:', 'You can conveniently use the text() function with XPath, which extracts the text value of the selected node.', 'If you are using CSS selectors, you’ll have to string two functions together: the first one will select the h1 element, while the second one will extract its text:', 'The result will look like this:', 'Check out the list of available parsing and data transformation functions here and some instruction examples here.'], ['{
