[('Getting started', [], []), ('How to use Custom Parser', [], []), ('Intro', ['To use Custom Parser, please provide a set of parsing_instructions when creating a job.', 'You can use OxyCopilot in the Web Scraper API Playground on our dashboard to generate parsing instructions automatically. Define schemas, validate data extraction, and export AI-generated parsing instructions in JSON format.', "Let's say you want to parse the number of total results Bing Search yields with a search term test:", 'An example job parameters would look as follows:', 'Step 1. You must provide the "parse": true parameter.', 'Step 2. Parsing instructions should be described in the "parsing_instructions" field.', 'The sample parsing instructions above specifies that the aim is to parse the number of search results from the scraped document and put the result in the number_of_results field. The instructions on how to parse the field by defining a “pipeline” is given:', 'The pipeline describes a list of data processing functions to be executed. The functions are executed in the order they appear on the list and take the output of the previous function as the input.', "In the sample pipeline above, the xpath_one function (full list of available functions) is used. It allows you to process an HTML document using XPath expressions and XSLT functions. As a function argument, specify the exact path where the target element can be found: .//span[@class='sb_count']. You can also instruct the parser to select the text() found in the target element.", 'The parsed result of the sample job above should look like this:', 'Custom Parser not only offers text extraction from a scraped HTML, but it can also execute basic data processing functions.', 'For example, the previously described parsing instructions extract number_of_results as a text with extra keywords you may not necessarily need. If you want to get the number of results for the given query=test in the numeric data type, you can reuse the same parsing instructions and add the amount_from_string function to the existing pipeline:', 'The parsed result of the sample job above should look like this:', 'We can see that it parsed the document accurately:'], ['{
